import React, { useState, useEffect } from 'react';

function MyComponent() {
  const [data, setData] = useState(null);

  function fetchData() {
    const url = 'https://zillow-com1.p.rapidapi.com/propertyExtendedSearch?location=santa%20monica%2C%20ca&home_type=Houses';
    const options = {
      method: 'GET',
      headers: {
        'X-RapidAPI-Key': 'e8e6d1cb20msh3c038ddf785e626p1a61ccjsn3f1d9d72ccb6',
        'X-RapidAPI-Host': 'zillow-com1.p.rapidapi.com'
      }
    };
    fetch(url, options)
      .then(res => res.json())
      .then(data => setData(data))
      .catch(error => console.error(error));
  }

  useEffect(() => {
    fetchData();
  }, []);

  return (
    <div>
      {data && (
        <ul>
          {data.results.map(result => (
            <li key={result.property_id}>
              <div>{result.address.street}</div>
              <div>{result.address.city}, {result.address.state} {result.address.zipcode}</div>
            </li>
          ))}
        </ul>
      )}
    </div>
  );
}

export default MyComponent;
